import React from 'react';
import school from './dashboardicons/university.png';
import admission from './dashboardicons/admission.png';
import work from './dashboardicons/course.png';
import index from './dashboardicons/index.png';
import professor from './dashboardicons/professor.png';
import research from './dashboardicons/research.png';
import fee from './dashboardicons/fee.png';
import finance from './dashboardicons/financeaid.png';
import expense from './dashboardicons/expense.png';
import forum from './dashboardicons/forum.png';
import housing from './dashboardicons/house.png';
import job from './dashboardicons/job.png';
import recreation from './dashboardicons/recreation.png';
import grocery from './dashboardicons/groceryy.png';
import restuarant from './dashboardicons/restuarant.png';
import others from './dashboardicons/others.png';

export const SidebarData = [
    {   
        title: "University/School",
        icon: <img src={school} alt='school'/>,
        link: "/university"
    },
    {
        title: "Admission Criteria",
        icon: <img src={admission} alt='admission'/>,
        link: "/admissioncriteria"
    },
    {
        title: "Course Work",
        icon: <img src={work} alt='course'/>,
        link: "/coursework"
    },
    {
        title: "Eligibilty Index",
        icon: <img src={index} alt='index'/>,
        link: "/eligibilityindex"
    },
    {
        title: "Professors",
        icon: <img src={professor} alt='professor'/>,
        link: "/professors"
    },
    {
        title: "Research Areas",
        icon: <img src={research} alt='research'/>,
        link: "/researchareas"
    },
    {
        title: "Course Fee",
        icon: <img src={fee} alt='fee'/>,
        link: "/coursefee"
    },
    {
        title: "Financial Info",
        icon: <img src={finance} alt='finance'/>,
        link: "/financialinfo"
    },
    {
        title: "Estimated Expenses",
        icon: <img src={expense} alt='expenses'/>,
        link: "/estimatedexpenses"
    },
    {
        title: "Student Forums",
        icon: <img src={forum} alt='forum'/>,
        link: "/studentforums"
    },
    {
        title: "Student Housing",
        icon: <img src={housing} alt='housing'/>,
        link: "/studenthousing"
    },
    {
        title: "On Campus Jobs",
        icon: <img src={job} alt='job'/>,
        link: "/jobs"
    },
    {
        title: "Recreational Activities",
        icon: <img src={recreation} alt='recreation'/>,
        link: "/activities"
    },
    {
        title: "Nearby Grocery Stores",
        icon: <img src={grocery} alt='grocery'/>,
        link: "/stores"
    },
    {
        title: "Nearby Restaurants",
        icon: <img src={restuarant} alt='restuarant'/>,
        link: "/restuarants"
    },
    {
        title: "Miscellaneous",
        icon: <img src={others} alt='others'/>,
        link: "/others"
    }
]
